const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Berserker</li><li>True name: Tamamo Cat</li><li>Height/Weight: 160cm/52kg</li><li>Source: Fate/Extra CCC</li><li>Region: SE.RA.PH</li><li>Alignment: Chaotic Good</li><li>Gender: Female</li></ul><p><strong>Meta</strong></p><ul><li>Creator: Kinoko Nasu</li><li>Character Design: WADA ARCO</li><li>Character voice: Chiwa Saitou</li><li>Main work appearance: Fate/Extra CCC</li></ul><p>(TL Note: The material entry said her creator is Higashide, but Higashide made a tweet back then to clarify that it was a typo and Nasu is the creator)</p><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B+</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">D</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Madness Enhancement: [C]</strong></p><p>All parameters are increased by 1 rank, but most of her reason is robbed. It\u2019s hard to call this a \u201Cmaddening\u201D effect since Tamamo Cat doesn\u2019t have much reason in the first place, but she\u2019s in that condition all the time so no one cares. Those around her are sometimes surprised by her complicated speech though.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Witchcraft: [E]</strong></p><p>Dakini\u2019s Divine Methods. Originally she mastered this powerful witchcraft, but when turning into this form she forgot all of them.</p><p><strong>Shapeshift: [B]</strong></p><p>To mold a borrowed body. Technique used by Chinese millennial fox yokai identified with Tamamo-no-mae. It was used by Daji to possess/transform during the Yin-Zhou revolution (described in Fengshen Yanyi - Investiture of the Gods). Due to past trauma, it is normally restricted. But \u201Cself-discipline\u201D, \u201Cself-derision\u201D, \u201Cself-control\u201D are not in her dictionary. Rather, all she has is \u201Cself-destruction\u201D.</p><p><strong>Monstrous Strength: [B]</strong></p><p>Ability of magic/demon beasts. Increase her physical strength. Fairly compatible right? She is excited. It\u2019s explosive wild power!.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="brilliant-sunlight-napping-wine-pool-and-meat-forest-sansan-nikkou-hiruyasumi-shuchinikurin" tabindex="-1"><a class="header-anchor" href="#brilliant-sunlight-napping-wine-pool-and-meat-forest-sansan-nikkou-hiruyasumi-shuchinikurin" aria-hidden="true">#</a> Brilliant Sunlight Napping Wine Pool and Meat Forest - Sansan Nikkou Hiruyasumi Shuchinikurin</h1><ul><li>Rank: D</li><li>Classification: Anti-Unit</li><li>Range: 1~40</li><li>Max targets: 30</li></ul><p>Derived from the Suiten Nikkou Amaterasu Yano Shizuishi. The \u201CWine Pool and Meat Forest\u201D is a torture game of \u201Creleasing humans into a forest full of tigers\u201D, but its meaning in the modern era has changed. The wild power of Tamamo Cat unleashed on the enemies, making them not feel so good. After that Tamamo Cat will take a nap, she will take a break for 1 turn but her HP is recovered. One must sleep after a workout and a meal, right?</p><p>(TL note: Wine Pool and Meat Forest is created by Daji).</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First pronoun: ware, it\u2019s actually \u201Cwatashi\u201D but it\u2019s not like it feels more intimate</li><li>Second pronoun: omae, goshujin</li><li>Third pronoun: aitsu</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>A wild beast-like existence that one doesn\u2019t know what she will do or want to do.</p><p>Since she is Berserker, communication is basically impossible.</p><p>She\u2019s only interested in fun and delicious things, and enjoy daily hunting life freely.</p><p>Despite being aggressive, it\u2019s actually \u201CThinking about it is troublesome so I\u2019ll just beat it up\u201D mindset she has. If you explain the situation to her in the easiest way to understand, you might somehow able to convince her to cooperate.</p><p>Because she is the offshoot of Tamamo-no-Mae, she also possess the power to perceive the principle of things and see the truth, she just does not say anything.</p><p>The parts that are not twisted, she is even more reliable than Tamamo-no-Mae herself when it comes to understanding.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>Conversation is pointless, as you can\u2019t comprehend her to make a response.</p><p>All she wants is to have fun and eat delicious food, but her pride as a wild beast means that she is forever loyal to those she considers her \u201Clord.\u201D</p><p>After the contract is formed, Tamamo Cat will become your earnest guardian beast who simply wants to help her Master.</p><p>Cat prioritizes her Master\u2019s wellbeing and happiness, ignoring her own.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u201CI am a member of the Tamamo Nine, Tamamo Cat! I end my lines with woof, my hobby is running a cafe, my favorite thing is carrot. I\u2019m unsettled without them.\u201D</p><p>\u201CAHAHAHAHA\u201D (when stabbing enemies)</p><p>\u201CWell this is difficult\u2026\u201D</p><p>\u201CHow about cat language?\u201D</p><p>\u201COr should I go with dog?\u201D</p><p>\u201CWith that, I\u2019m taking a carrot as reward!\u201D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>A member of the Tamamo Nine.</p><p>After Tamamo-no-Mae went through 1000 years of training to regain divine status she regained all tails, then when she returned to 1 tail form she cut off the other 8. Each of them obtained divine status as bunrei of Tamamo and become heroic spirits. This is the crystallization of Tamamo-no-Mae\u2019s (relatively) pure aspect.</p><p>While the Tamamo Nine are just sad existences to be defeated in \u201CFate/Extra\u201D series, in FGO when she meet an extraordinary lord she\u2019s the first of them to change mind.</p><p>Based on Neko Arc. She is not involved in the main story. If that time comes, it will be the end of FGO.</p><p>Her cooking skill is better than the Original. It\u2019s probably due to the result of working part-time at a maid cafe as a training ground.</p><p>(TL Note: Neko Arc is the gag character cat version of Arcueid Brunestud from Tsukihime. Tamamo Cat is basically Neko Tamamo)</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Tamamo-no-Mae</strong></p><p>The Original must be defeated, but a wise Cat knows that even if she managed to beat the Original, it won\u2019t solve anything. Fighting is meaningless.</p><p><strong>Atalanta</strong></p><p>Hoho, a Mediterranean Sea cat huh...You\u2019re not very fleshy. I\u2019m worried, do you eat dried sardines properly?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Since Chaos or Order is fine, I drew her with no plan at all. But similar to Elizabeth her battle sprite cannot be changed at the moment, so the thought of her stucking in naked apron forever is oops. And then I messed up the words on her omelette rice (the maid ascension form). I wanted to write \u201CTAMAMO-chan\u201D or \u201CTAMAMO-nyan\u201D but it became \u201CTAMAMO-nhan\u201D. I can\u2019t read. I just realized that when writing this comment. I\u2019m sorry. I\u2019m sorry!(Wada Arco).</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-170.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-171.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-172.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-173.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-174.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-175.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-176.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-177.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-178.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-179.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 72);
